  null,\n\t\"notes\": \"The Coastal Zone Color Scanner Experiment (CZCS) was the first
  instrument devoted tonthe measurement of ocean color and flown on a spacecraft.
  Although other instrumentsnflown on other spacecraft had sensed ocean color, their
  spectral bands, spatialnresolution and dynamic range were optimized for land or
  meteorological use and hadnlimited sensitivity in this area, whereas in CZCS, every
  parameter was optimized fornuse over water to the exclusion of any other type of
  sensing. CZCS had six spectralnbands, four of which were used primarily for ocean
  color. These were of a 20 nanometernbandwidth centered at 443, 520, 550, and 670
  nm. Band 5 had a 100 nm bandwidth centerednat 750 nm and a dynamic range more suited
  to land. Band 6 operated in the 10.5 to 12.5nmicrometer region and sensed emitted
  thermal radiance for derivation of equivalentnblack body temperature. (This thermal
  band failed within the first year of the mission,nand so was not used in the global
  processing effort.) Bands 1-4 were preset to viewnwater only and saturated when
  the IFOV was over most types of land surfaces, or clouds.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
